import { useEffect, useState } from 'react';
import { endPoints, getVideoList, Video } from '../../data/api/videoApi';
import Movies from '../comp/display/movies/Movies';

export default function MainPage() {
  const [originals, setOriginals] = useState<Video[]>([]);
  const [trendings, setTrendings] = useState<Video[]>([]);
  const [nowPlaying, setNowPlaying] = useState<Video[]>([]);
  const [popular, setPopular] = useState<Video[]>([]);
  const [topRated, setTopRated] = useState<Video[]>([]);
  const [upcoming, setUpcoming] = useState<Video[]>([]);

  useEffect(() => {
    getVideoList(endPoints.originals).then((data: Video[]) => setOriginals(data));
    getVideoList(endPoints.top_rated).then((data: Video[]) => setTrendings(data));
  }, []);

  return (
    <>
      <Movies title='Netflix originals' movies={originals} />
      <Movies title='Netflix originals' movies={trendings} />
    </>
  );
}
